フォーリングバイト対応!ジグの重さで貫通する。
かすかなカーブポイント「シワリ型」。ぐらつきを抑え、点で貫く特性をもち、少ない力で貫く。ジグの重さだけでフッキング。
丸軸断面。最も負荷がかかる場所を丸軸にすることにより、身切れによるバラシを減少させる。
魚をホールドするコーナー。リーリング時に魚をホールドする個所を?に集中させ、魚肉のズレを抑える
平打ち(プレス)。魚肉に干渉しない部分は平打ち処理を施し、強度を確保。
ワイドゲイプ。フッキング率を向上させるひろいゲイブ幅。
