「最強の素材&times;練達の技」最強の称号「タフワイヤー」誕生。"刺さればヌケない、バレに強い。"【ホールド】「一度貫いたら、抜けない、逃がさない」こういったフォルムを持つフックは従来、なぜかハリ先はカーブが多かった・・。こいつは違います。ストレートでまず掛けて、貫通したら抜けはもうありません。どこからでも掛け、刺し、しかも逃がさない。ジギングのために生まれた恐ろしいハリです。スローな操作で、魚の口腔部に吸わせたら、さらに完璧です。待望の追加サイズ!!　6/0・7/0登場です。※形状について。カルティバジギングフックの中では最も細いジギングフックであり、「超細軸」という位置づけとなります。よって対貫通性能において真価を発揮するために形状は6/0・7/0のみ限定フォルムです。<style>
